const Target = require('../../models/target')

describe('Get Targets', () => {
  const expected = {
    description: 'Welcome to us',
    image: 'data:image/jpeg;base64,',
    place: 'Geldrop',
    lat: 51.4107812,
    long: 5.5583965
  }

  it('Create user without userId', async () => {
    const target = new Target({
      ...expected
    })

    const error = target.validateSync()
    expect(error.errors.userId.message).toEqual('Path `userId` is required.')
  })

  it('Create target', async () => {
    const target = new Target({
      userId: '6251857383fd40fe5f3e1ac0',
      ...expected
    })

    const error = target.validateSync()
    expect(error).toBeUndefined()
  })

  it('Create target without image', async () => {
    const target = new Target({
      userId: '6251857383fd40fe5f3e1ac0',
      ...expected
    })

    const error = target.validateSync()
    expect(error).toBeUndefined()
  })
})
